window.bookSummaryJSON = "<p><b>Julian</b></p> <p>If I ever caught on fire, Dahlia Muñoz would fan the flames with a smile. So, when she returns to Lake Wisteria, I fully intend to avoid the interior designer. At least until my meddling mother exploits my savior complex.</p> <p>The faster I help Dahlia find her creative spark, the sooner she will leave town. But while I was busy getting rid of Dahlia, I overlooked one potential issue. What happens if I want her to stay?</p> <p><b>Dahlia</b></p> <p>People say the devil has many faces, but I know only one. Julian Lopez—my childhood rival and family frenemy. I vow to steer clear of him while recovering from my broken engagement, but then the billionaire makes an irresistible offer. Renovate a historic house together and triple our profits.</p> <p>Our temporary truce becomes compromised as we face years’ worth of denied attraction and mixed emotions. Giving into our desire is inevitable...but falling in love? That isn’t part of the plan.</p> <p><i>Love Redesigned</i> is a steamy small-town romance about two family friends-turned-childhood rivals. It is the first book in the stand-alone Lakefront Billionaires series and has a happy ending.</p>"; 
